export const MOVIE_SEARCH_SUCCESS = 'MOVIE_SEARCH_SUCCESS';

const initialState = {
  loading: false,
  response: false,
};

function movieSearch(state = initialState, action) {
  switch (action.type) {
    case MOVIE_SEARCH_SUCCESS:
      return {
        ...state,
        loading: false,
        movies: action.payload && action.payload.movies ? action.payload.movies.search : {}
      };
    default:
      return state;
  }
}

export default movieSearch;
